INSERT INTO `tb_aboutschool` (`about_id`, `about_menu`, `about_detail`, `about_date`, `about_personnel_id`) VALUES
('about_001', 'ประวัติโรงเรียน', '<p>... อยู่ระหว่างการปรับปรุง ...</p>', '2020-05-07 12:51:29', '1'),
('about_002', ' วิสัยทัศน์ พันธกิจ', '<p data-adtags-visited=\"true\"><strong>วิสัยทัศน์</strong><br />&ldquo;สร้างผู้นำ&nbsp; คุณธรรมดี&nbsp; กีฬาเด่น&nbsp; เป็นสังคมแห่งการเรียนรู้&rdquo;</p>\r\n<p data-adtags-visited=\"true\"><strong>อัตลักษณ์</strong><br />&ldquo;สุภาพบุรุษ-สุภาพสตรีสวนกุหลาบ&rdquo;</p>\r\n<p data-adtags-visited=\"true\"><strong>เอกลักษณ์</strong><br />&ldquo;ภูมิทัศน์ร่มรื่น สดชื่นสวยงาม พร้อมบริการชุมชน&rdquo;</p>\r\n<p data-adtags-visited=\"true\"><strong>พันธกิจ</strong><br />1.ส่งเสริมการสร้างความเป็นผู้นำตามอัตลักษณ์ของนักเรียนในเครือสวนกุหลาบ<br />2.ส่งเสริมการสร้างคุณธรรม จริยธรรมและค่านิยมที่ถูกต้อง<br />3.ส่งเสริมการออกกำลังกายและพัฒนาไปสู่ความเป็นเลิศทางการกีฬา<br />4.ส่งเสริมการเรียนรู้ตลอดชีวิต จากการสร้างบรรยากาศให้เป็นสังคมแห่งการเรียนรู้</p>\r\n<p data-adtags-visited=\"true\"><strong>เป้าประสงค์</strong><br />1.นักเรียนมีความเป็นผู้นำตามอัตลักษณ์ของนักเรียนในเครือสวนกุหลาบ<br />2.นักเรียน ครูและบุคลากรทางการศึกษา มีคุณธรรม จริยธรรมและค่านิยมที่ถูกต้อง<br />3.นักเรียนมีพฤติกรรมการออกกำลังกายอย่างสม่ำเสมอและพัฒนาไปสู่ความเป็นเลิศทางการกีฬา</p>\r\n<p data-adtags-visited=\"true\">นักเรียน ครูและบุคลากรทางการศึกษา มีพฤติกรรมรักการเรียนรู้ตลอดชีวิต และสถานศึกษามีบรรยากาศเป็นสังคมแห่งการเรียนรู้</p>', '2020-04-16 16:04:11', '1');
INSERT INTO `tb_aboutschool` (`about_id`, `about_menu`, `about_detail`, `about_date`, `about_personnel_id`) VALUES
('about_003', 'ปรัชญา/คติพจน์', '<h3 style=\"text-align: center;\"><img title=\"Suankularb_Logo.png\" src=\"data:image/png;base64,\" alt=\"\" width=\"202\" height=\"240\" /></h3>\r\n<h4 style=\"text-align: center;\">&ldquo;สุวิชาโน ภวํ โหติ&rdquo; แปลว่า &ldquo;ผู้รู้ดีเป็นผู้เจริญ<br />\"เป็นผู้นำ รักเพื่อน นับถือพี่ เคารพครู กตัญญูพ่อแม่ ดูแลน้อง\" คือลูกสวนกุหลาบ</h4>', '2020-04-16 16:08:14', '1');
INSERT INTO `tb_aboutschool` (`about_id`, `about_menu`, `about_detail`, `about_date`, `about_personnel_id`) VALUES
('about_004', 'ตราสัญลักษณ์ของโรงเรียน', '<p style=\"text-align: center;\"><img title=\"Suankularb_Logo.png\" src=\"data:image/png;base64,\" alt=\"\" width=\"202\" height=\"240\" /></p>\r\n<h3 style=\"text-align: center;\">ตราประจำโรงเรียน</h3>\r\n<p>พระตำหนักสวนกุหลาบซึ่งได้ขอพระราชทานพระบรมราชานุญาติใช้ตรานี้ เมื่อ พ.ศ. 2475&nbsp; มีลักษณะดังนี้เป็นรูปหนังสือมีไม้บรรทัดดินสอปากกาคั่นอยู่ หน้าปกหนังสือมี<a title=\"พระเกี้ยว\" href=\"https://th.wikipedia.org/wiki/%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B9%80%E0%B8%81%E0%B8%B5%E0%B9%89%E0%B8%A2%E0%B8%A7\">พระเกี้ยวยอด</a>หรือจุลมงกุฏ และอักษรย่อ จ.ป.ร. ด้านขวามีช่อดอกกุหลาบ มุมซ้ายล่างมีริบบิ้นผูกช่อดอกกุหลาบ ซึ่งมีตัวหนังสือกำกับว่า \"โรงเรียนหลวงสวนกุหลาบ\" ด้านบนปรากฏมีปรัชญาและคติพจน์ \"สุวิชาโน ภวํ โหติ\" ด้านล่างมีคำแปลว่า \"ผู้รู้ดี เป็นผู้เจริญ\"</p>', '2020-04-16 16:09:54', '1');
INSERT INTO `tb_aboutschool` (`about_id`, `about_menu`, `about_detail`, `about_date`, `about_personnel_id`) VALUES
('about_005', 'อักษรย่อ/สี/ต้นไม้ประจำโรงเรียน', '<p><strong>&nbsp;ต้นไม้ประจำโรงเรียน :</strong> ต้นชมพูพันธุ์ทิพย์<br /><strong>&nbsp;ตัวอักษรย่อ&nbsp;</strong><strong>:</strong>&nbsp;สกจ.<br /><strong>&nbsp;สีประจำโรงเรียน&nbsp;</strong><strong>:</strong>&nbsp;\"ชมพู - ฟ้า\"&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n<ul>\r\n<li>สีชมพู เป็นสีประจำวันพระราชสมภพใน&nbsp;<a title=\"พระบาทสมเด็จพระจุลจอมเกล้าเจ้าอยู่หัว\" href=\"https://th.wikipedia.org/wiki/%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%9A%E0%B8%B2%E0%B8%97%E0%B8%AA%E0%B8%A1%E0%B9%80%E0%B8%94%E0%B9%87%E0%B8%88%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%88%E0%B8%B8%E0%B8%A5%E0%B8%88%E0%B8%AD%E0%B8%A1%E0%B9%80%E0%B8%81%E0%B8%A5%E0%B9%89%E0%B8%B2%E0%B9%80%E0%B8%88%E0%B9%89%E0%B8%B2%E0%B8%AD%E0%B8%A2%E0%B8%B9%E0%B9%88%E0%B8%AB%E0%B8%B1%E0%B8%A7\">พระบาทสมเด็จพระจุลจอมเกล้าเจ้าอยู่หัว</a>&nbsp;พระพุทธเจ้าหลวง</li>\r\n<li>สีฟ้า เป็นสีประจำวันพระราชสมภพใน&nbsp;<u><a title=\"\" href=\"https://th.wikipedia.org/wiki/%E0%B8%AA%E0%B8%A1%E0%B9%80%E0%B8%94%E0%B9%87%E0%B8%88%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%A8%E0%B8%A3%E0%B8%B5%E0%B8%9E%E0%B8%B1%E0%B8%8A%E0%B8%A3%E0%B8%B4%E0%B8%99%E0%B8%97%E0%B8%A3%E0%B8%B2%E0%B8%9A%E0%B8%A3%E0%B8%A1%E0%B8%A3%E0%B8%B2%E0%B8%8A%E0%B8%B4%E0%B8%99%E0%B8%B5%E0%B8%99%E0%B8%B2%E0%B8%96_%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%9A%E0%B8%A3%E0%B8%A1%E0%B8%A3%E0%B8%B2%E0%B8%8A%E0%B8%8A%E0%B8%99%E0%B8%99%E0%B8%B5%E0%B8%9E%E0%B8%B1%E0%B8%99%E0%B8%9B%E0%B8%B5%E0%B8%AB%E0%B8%A5%E0%B8%A7%E0%B8%87\">สมเด็จพระศรีพัชรินทราบรมราชินีนาถ พระบรมราชชนนีพันปีหลวง</a></u></li>\r\n</ul>\r\n<p style=\"text-align: center;\"><img src=\"https://skj.thai.ac/client-upload/skj/uploads/images/flag.png\" alt=\"\" width=\"564\" height=\"377\" />&nbsp; &nbsp;</p>\r\n<p>&nbsp; <img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://4.bp.blogspot.com/-68aSLxz8ZOY/UsetIHuP2nI/AAAAAAAAAEE/m1RkO9YKQS0/s1600/chompoo.jpg\" alt=\"\" width=\"600\" height=\"400\" /></p>', '2020-05-07 14:14:10', '1'),
('about_006', 'อัตลักษณ์/เอกลักษณ์', '<p style=\"text-align: center;\"><u><strong>อัตลักษณ์</strong></u></p>\r\n<p style=\"text-align: center;\">&ldquo;สุภาพบุรุษ-สุภาพสตรีสวนกุหลาบ&rdquo;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><u><strong>เอกลักษณ์</strong></u></p>\r\n<p style=\"text-align: center;\">&ldquo;ภูมิทัศน์ร่มรื่น สดชื่นสวยงาม พร้อมบริการชุมชน&rdquo;</p>', '2020-04-16 21:49:11', '1'),
('about_007', 'ที่ตั้ง/แผนผัง', '<p style=\"text-align: center;\"><strong>โรงเรียนสวนกุหลาบวิทบาลัย(จิรประวัติ)นครสวรรค์</strong><br />160 ม.1 ต.นครสวรรค์ออก อ.เมืองนครสวรรค์ จ.นครสวรรค์ 60000</p>\r\n<p style=\"text-align: center;\"><iframe style=\"border: 0;\" tabindex=\"0\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3841.627998181076!2d100.12847381480245!3d15.664785689131884!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x30e04ef4b6c7ba7f%3A0x5d7eda9c381eaa67!2z4LmC4Lij4LiH4LmA4Lij4Li14Lii4LiZ4Liq4Lin4LiZ4LiB4Li44Lir4Lil4Liy4Lia4Lin4Li04LiX4Lii4Liy4Lil4Lix4LiiICjguIjguLTguKPguJvguKPguLDguKfguLHguJXguLQpIOC4meC4hOC4o-C4quC4p-C4o-C4o-C4hOC5jA!5e0!3m2!1sth!2sth!4v1587048756737!5m2!1sth!2sth\" width=\"100%\" height=\"600\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\" aria-hidden=\"false\"></iframe></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>', '2020-04-16 21:55:25', '1');

